void init_measurement(struct timeval * userTmp, struct timeval * sysTmp, struct rusage * usage) {
  getrusage (RUSAGE_SELF, usage);
  (*userTmp)=(*usage).ru_utime;
  (*sysTmp)=(*usage).ru_stime;
}

void finish_measurement(struct rusage * usage) {
  getrusage (RUSAGE_SELF, usage);
}

void print_result(struct timeval * userTmp, struct timeval * systemTmp, struct rusage * usage) {
  printf ("CPU time: sec user: %ld.%09ld ,sec system  %ld.%09ld real time :%ld.%09ld\n\n",
      (*usage).ru_utime.tv_sec-(*userTmp).tv_sec, (*usage).ru_utime.tv_usec-(*userTmp).tv_usec,
      (*usage).ru_stime.tv_sec-(*systemTmp).tv_sec, (*usage).ru_stime.tv_usec-(*systemTmp).tv_usec,
      (*usage).ru_stime.tv_sec-(*systemTmp).tv_sec + (*usage).ru_utime.tv_sec-(*userTmp).tv_sec, (*usage).ru_stime.tv_usec-(*userTmp).tv_usec + (*usage).ru_utime.tv_usec-(*systemTmp).tv_usec);
}


int main(int argc, char const *argv[]) {

  struct rusage usage;
  struct timeval userTmp,systemTmp;
  tree_contacts * tree= create_tree(SURNAME);
  getrusage (RUSAGE_SELF, &usage);
  printf("Created tree\n" );
  printf ("CPU time: sec user: %ld.%09ld ,sec system  %ld.%09ld real time :%ld.%09ld\n\n",
     usage.ru_utime.tv_sec, usage.ru_utime.tv_usec,
     usage.ru_stime.tv_sec, usage.ru_stime.tv_usec,
     usage.ru_stime.tv_sec + usage.ru_utime.tv_sec, usage.ru_stime.tv_usec + usage.ru_utime.tv_usec);

   //testing adding 1000 nodes

   init_measurement(&userTmp, &systemTmp, &usage);
   add_to_tree(&tree);
   finish_measurement(&usage);
   printf("Added 1000 contacts\n" );
   print_result(&userTmp, &systemTmp, &usage);

    //testing  sorting

   init_measurement(&userTmp, &systemTmp, &usage);
   rebuild_tree(&tree,EMAIL) ;
   finish_measurement(&usage);
   printf("Tree was sorted by another key\n" );
   print_result(&userTmp, &systemTmp, &usage);

   //test searching
   init_measurement(&userTmp, &systemTmp, &usage);
   search_node(tree, (char *) "Aenean.euismod.mauris@diamPellentesquehabitant.edu");
   finish_measurement(&usage);
   printf("Found \"optimistic\" contact\n" );
  //  printf("%s %s %s %s %s %s \n", node->data[NAME],node->data[SURNAME],node->data[EMAIL],node->data[PHONE],node->data[BIRTHDATE],node->data[ADDRESS]);
   print_result(&userTmp, &systemTmp, &usage);

   init_measurement(&userTmp, &systemTmp, &usage);
   search_node(tree, (char *) "vulputate@tinciduntnequevitae.net");
   finish_measurement(&usage);
   printf("Found \"pesimistic\" contact\n" );
   print_result(&userTmp, &systemTmp, &usage);

   //test deleting
   init_measurement(&userTmp, &systemTmp, &usage);
   delete_node(&tree, (char *) "Aenean.euismod.mauris@diamPellentesquehabitant.edu");
   finish_measurement(&usage);
   printf("Removed \"optimistic\" contact\n" );
   print_result(&userTmp, &systemTmp, &usage);

   init_measurement(&userTmp, &systemTmp, &usage);
   delete_node(&tree, (char *) "vulputate@tinciduntnequevitae.net");
   finish_measurement(&usage);
   printf("Removed \"pesymistic\" contact\n" );
   print_result(&userTmp, &systemTmp, &usage);

   printf("Time of working program\n" );
   printf ("CPU time: sec user: %ld.%09ld ,sec system  %ld.%09ld real time :%ld.%09ld\n\n",
      usage.ru_utime.tv_sec, usage.ru_utime.tv_usec,
      usage.ru_stime.tv_sec, usage.ru_stime.tv_usec,
      usage.ru_stime.tv_sec + usage.ru_utime.tv_sec, usage.ru_stime.tv_usec + usage.ru_utime.tv_usec);

    // print_tree(tree);
    delete_tree(&tree);
  return 0;
}
